/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_billing_advance_charges` AS (select `a`.`tenant_id` AS `tenant_id`,`a`.`encounter_id` AS `encounter_id`,`a`.`patient_id` AS `patient_id`,`a`.`payment_id` AS `payment_id`,`a`.`payment_date` AS `payment_date`,`a`.`card_type` AS `card_type`,`a`.`card_number` AS `card_number`,`a`.`bank_name` AS `bank_name`,`a`.`bank_number` AS `bank_number`,`a`.`bank_date` AS `bank_date`,'Advance Charge' AS `category`,concat('Voucher (',`a`.`payment_id`,')') AS `headers`,0 AS `charge`,0 AS `visit_count`,(case `a`.`payment_mode` when 'CA' then 'Cash' when 'CD' then 'Card' when 'ON' then 'Online' when 'CH' then 'Cheque' else NULL end) AS `trans_mode`,`a`.`payment_amount` AS `total_charge`,0 AS `extra_amount`,0 AS `concession_amount` from `pat_billing_payment` `a` where ((`a`.`status` = '1') and (`a`.`deleted_at` = '0000-00-00 00:00:00'))) */;

